export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},lOm1Jr7RVT:{data:{id:1299,attributes:{imdbId:"tt0099697",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNGE0YjdhZTAtZDI0ZC00ZDk1LTkyZjgtMWE1OTJkYWZiNjA4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.0\u002F10"},{Source:"Rotten Tomatoes",Value:"0%"},{Source:"Metacritic",Value:"28\u002F100"}],item_lang:{data:{id:1962,attributes:{title:"Graveyard Shift",plot:"In a dark and nasty textile factory close to a cemetery and infested of rats, many workers are missing. When the corrupt manager Warwick is forced by a sanitary agent to hire the exterminator Tucker Cleveland, he asks Tucker to use less poison than necessary to reduce the costs. Meanwhile, the drifter John Hall applies for a job and accepts the position of operator of a textile machine in the graveyard shift. What they do not know is that there is a huge creature is in the underground of the mill threatening the workers.",slug:"graveyard-shift"}}},books:{data:[{id:1011,attributes:{title:"Danse Macabre",description:"From the author of dozens of #1 New York Times bestsellers and the creator of many unforgettable movies comes a vivid, intelligent, and nostalgic journey through three decades of horror as experienced through the eyes of the most popular writer in the genre. In 1981, years before he sat down to tackle On Writing, Stephen King decided to address the topic of what makes horror horrifying and what makes terror terrifying. Here, in ten brilliantly written chapters, King delivers one colorful observation after another about the great stories, books, and films that comprise the horror genre—from Frankenstein and Dracula to The Exorcist, The Twilight Zone, and Earth vs. The Flying Saucers. With the insight and good humor his fans appreciated in On ?Writing , Danse Macabre is an enjoyably entertaining tour through Stephen King’s beloved world of horror.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Rs1WbPRa3LoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2011-03-01",publisher:"Simon and Schuster",subtitle:d}},{id:1012,attributes:{title:"Night Shift",description:"Stephen King’s first collection of short stories showcases the darkest depths of his brilliant imagination and will \"chill the cockles of many a heart\" (Chicago Tribune). Featuring “Jerusalem’s Lot,\" the basis for the upcoming tv series Chapelwaite. Here we see mutated rats gone bad (“Graveyard Shift”); a cataclysmic virus that threatens humanity (“Night Surf,” the basis for The Stand); a possessed, evil lawnmower (“The Lawnmower Man”); unsettling children from the heartland (“Children of the Corn”); a smoker who will try anything to stop (“Quitters, Inc.”); a reclusive alcoholic who begins a gruesome transformation (“Gray Matter”); and many more shadows and visions that will haunt you long after the last page is turned.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YTDDiSUsD-EC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:b,published:"2008-06-24",publisher:"Anchor",subtitle:d}},{id:1013,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:b,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}},{id:1014,attributes:{title:"The Shape Under the Sheet",description:"This reference source on Stephen King's fiction provides details about characters, places and objects in each of King's novels and short stories and includes a biography section, interviews with family, friends and contemporaries, and sections on film adaptations and audio versions of his work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wHUaAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Stephen J. Spignesi"],firstBook:b,published:"1991-01-01",publisher:"Popular Culture Ink",subtitle:"The Complete Stephen King Encyclopedia"}},{id:1015,attributes:{title:"Stephen King's Danse Macabre",description:"Information on the horror phenomenon including books, movies, radio, and T.V.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oPYGelk-5GYC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:"1983-01-01",publisher:"Berkley",subtitle:d}}]}}},meta:{}}},prerenderedAt:1682568494712}}("movie",null,"Stephen King","","series",1))